<?php

namespace App\Services;

use Illuminate\Support\Facades\DB;

class WhatsAppService
{
    public function saveMessate2Image($message, $url){
    
        // Decodificar el contenido Base64
        $imageData = base64_decode($message);

        // Verificar si la decodificación fue exitosa
        if ($imageData === false) {
            return response()->json(['error' => 'No se pudo decodificar el contenido Base64.'], 400);
        }

        // Ruta donde guardarás la imagen PNG
        $outputPath = storage_path('app/public/output_image.png');

        // Guardar los datos decodificados como un archivo PNG
        file_put_contents($outputPath, $imageData);

        // Retornar la ruta del archivo guardado
        return response()->json(['message' => 'Imagen PNG guardada correctamente.', 'path' => $outputPath]);
    }

    public function saveDemo(){
        $messsage = "":
        $this->saveMessate2Image($messsage, "algo.jpg");
    }
}